In plain Ruby, this could look something like: class PostAuthorizer def initialize(user, post) @post = user @user = user end def show? true end def update? @post.organization.users.include?(@user) end
end Then, within the code where you want to check, you'd call out with: if PostAuthorizer.new(user, post).update? post.update!(params)
end That's all well and good! It's just simple Ruby objects and easy to test. But it's not exactly the nicest API. The code for defining an authorizer could be simplified. Maybe there's a way to define multiple actions that are available to all or a default. Something like: class PostAuthorizer public :show, :like
end What if there was a simpler API for checking authorization, like: authorized_to_update?(user, post)
authorized_to_read?(user, post)
authorized_to_like?(user, post) What's possible for defining these sorts of APIs will vary based on languages, but these are just some off-the-cuff ideas. Whether you use inheritance or composition or functions is totally up to you.
